Actionscript.script:
function 攻击时移动(慢速度, 快速度)
{
	if (_parent.方向 == "右")
	{
		_parent.移动("右",慢速度);
	}
	else if (_parent.方向 == "左")
	{
		_parent.移动("左",慢速度);
	}
}
function 攻击时四向移动(上, 下, 左, 右)
{
	if (上 != 0)
	{
		_parent.移动("上",上);
	}
	else if (下 != 0)
	{
		_parent.移动("下",下);
	}
	if (左 != 0)
	{
		_parent.方向改变("左");
		_parent.移动("左",左);
	}
	else if (右 != 0)
	{
		_parent.方向改变("右");
		_parent.移动("右",右);
	}
}

if(_parent.hp <= 0)
{
   stop();
   if(_parent.已加经验值 != true)
   {
      if(_parent.是否为敌人 == true)
      {
         _root.敌人死亡计数 = _root.敌人死亡计数 + 1;
         _root.gameworld[_parent.产生源].僵尸型敌人场上实际人数--;
         _root.gameworld[_parent.产生源].僵尸型敌人总个数--;
         _parent.计算经验值();
      }
      _parent.人物文字信息._visible = 0;
      _root.add2map(_parent,2);
      _parent.removeMovieClip();
   }
}

if(_parent.hp <= 0)
{
   stop();
}
if(_parent.hp <= 0)
{
   stop();
}
if(_parent.hp == 0)
{
   stop();
}
if(_parent.hp < 0)
{
   stop();
}
